import './login.css';

const Login = () => {

    return (
        <main class="main">
            <div class="main_head">
                <div class="main_section">
                    <div class="login">
                    <h2>Welcome back</h2>
                    <input id = "login" type="text" placeholder="Username"/>
                    <input id = "password" type="password" placeholder="Password"/>
                    <button id = "log_button">Login</button>
                    </div>
                </div>
            </div>
        </main>
    )
}

export default Login;
